import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const ProjectListPage = () => {
  const navigate = useNavigate();
  const [filter, setFilter] = useState("all"); // all, ongoing, upcoming, closed

  // 임시 프로젝트 데이터
  const projects = [
    {
      id: 1,
      title: "강남 역세권 주거시설",
      location: "서울시 강남구",
      expectedReturn: 12,
      period: "12개월",
      totalAmount: 100000000,
      currentAmount: 67000000,
      status: "ongoing",
      daysLeft: 7,
      thumbnail: "https://via.placeholder.com/300x200",
    },
    {
      id: 2,
      title: "부산 해운대 레지던스",
      location: "부산시 해운대구",
      expectedReturn: 15,
      period: "18개월",
      totalAmount: 200000000,
      currentAmount: 150000000,
      status: "ongoing",
      daysLeft: 14,
      thumbnail: "https://via.placeholder.com/300x200",
    },
    // 더미 데이터 추가 가능
  ];

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* 헤더 섹션 */}
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900">투자 프로젝트</h1>
          <p className="mt-2 text-gray-600">
            다양한 부동산 투자 기회를 만나보세요
          </p>
        </div>

        {/* 필터 섹션 */}
        <div className="mb-6 flex flex-wrap gap-4">
          <button
            onClick={() => setFilter("all")}
            className={`px-4 py-2 rounded-full ${
              filter === "all"
                ? "bg-green-600 text-white"
                : "bg-white text-gray-700 border border-gray-300"
            }`}
          >
            전체 프로젝트
          </button>
          <button
            onClick={() => setFilter("ongoing")}
            className={`px-4 py-2 rounded-full ${
              filter === "ongoing"
                ? "bg-green-600 text-white"
                : "bg-white text-gray-700 border border-gray-300"
            }`}
          >
            진행중
          </button>
          <button
            onClick={() => setFilter("upcoming")}
            className={`px-4 py-2 rounded-full ${
              filter === "upcoming"
                ? "bg-green-600 text-white"
                : "bg-white text-gray-700 border border-gray-300"
            }`}
          >
            오픈예정
          </button>
          <button
            onClick={() => setFilter("closed")}
            className={`px-4 py-2 rounded-full ${
              filter === "closed"
                ? "bg-green-600 text-white"
                : "bg-white text-gray-700 border border-gray-300"
            }`}
          >
            마감
          </button>
        </div>

        {/* 프로젝트 그리드 */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {projects.map((project) => (
            <div
              key={project.id}
              className="bg-white rounded-lg shadow-md overflow-hidden cursor-pointer transform transition hover:scale-105"
              onClick={() => navigate(`/investment/project/${project.id}`)}
            >
              <img
                src={project.thumbnail}
                alt={project.title}
                className="w-full h-48 object-cover"
              />
              <div className="p-4">
                <h3 className="text-lg font-semibold text-gray-900">
                  {project.title}
                </h3>
                <p className="text-gray-600">{project.location}</p>

                <div className="mt-4 space-y-2">
                  <div className="flex justify-between">
                    <span className="text-gray-600">예상 수익률</span>
                    <span className="text-green-600 font-semibold">
                      {project.expectedReturn}%
                    </span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">투자 기간</span>
                    <span>{project.period}</span>
                  </div>

                  {/* 진행률 바 */}
                  <div className="mt-4">
                    <div className="w-full bg-gray-200 rounded-full h-2">
                      <div
                        className="bg-green-600 h-2 rounded-full"
                        style={{
                          width: `${
                            (project.currentAmount / project.totalAmount) * 100
                          }%`,
                        }}
                      />
                    </div>
                    <div className="flex justify-between mt-1 text-sm">
                      <span>
                        {Math.round(
                          (project.currentAmount / project.totalAmount) * 100
                        )}
                        % 달성
                      </span>
                      <span className="text-green-600">
                        D-{project.daysLeft}
                      </span>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ProjectListPage;
